"use strict"
import {
  CVMMetaSection,
  CVMMetaEntry,
  CVMMetaGenerator,
  CVMMetaParser
} from './../lib/MetaData.js'
import {
  CWindow
} from "/lib/window.js"

var terminalBody = `
<style>#terminal{
  padding-left: 0.4em;
  height: 100%;
  width: 100%;
  background-color: transparent;

}
.xterm-text-layer
{
  padding-right:10px !important;
}
</style>

    <div id="terminal"></div>
`;
class CTerminal extends CWindow {

  constructor(positionX, positionY, width, height) {
    super(positionX, positionY, width, height, terminalBody, "Terminal", CTerminal.getIcon(), false);
    this.disableVerticalScroll();
    this.mLastHeightRearangedAt = 0;
    this.mThreadActive = false;
    this.mLastWidthRearangedAt = 0;
    this.mDomainID = "";
    this.mERGBig = 0;
    this.mERGLimit = 0;
    this.mRecipientID = "";
    this.mBalance = '0';
    this.mErrorMsg = "";
    this.setThreadID = 'XTERM_THREAD_' + this.getProcessID;
    this.mLastPastedTimestamp = 0;
    this.mLastTimeConsoleResized = 0;
    this.mFitAddon = null;
    //register for network events
    CVMContext.getInstance().addVMMetaDataListener(this.newVMMetaDataCallback.bind(this), this.mID);
    CVMContext.getInstance().addNewDFSMsgListener(this.newDFSMsgCallback.bind(this), this.mID);
    CVMContext.getInstance().addNewGridScriptResultListener(this.newGridScriptResultCallback.bind(this), this.mID);
    CVMContext.getInstance().addNewTerminalDataListener(this.newTerminalDataCallback.bind(this), this.mID);
    CVMContext.getInstance().addVMStateChangedListener(this.VMStateChangedCallback.bind(this), this.mID);
    this.mInitedTerminalView = false;
    this.lastWidthRefitAt = 0;
    this.lastHeightRefitAt = 0;
    this.loadLocalData();
    this.mSpecialKeys = new Array(37, 38, 39, 40, 8, 13, 127);

    //JavaScript key-codes
    this.JS_ARROW_UP = 38;
    this.JS_ARROW_DOWN = 40;
    this.JS_ARROW_LEFT = 37;
    this.JS_ARROW_RIGHT = 39;

    //SSH key-codes
    this.SSH_ARROW_UP = 65;
    this.SSH_ARROW_DOWN = 66;
    this.SSH_ARROW_LEFT = 68;
    this.SSH_ARROW_RIGHT = 67;

    var msec = 1000;

  }

  static getPackageID() {
    return "org.gridnetproject.UIdApps.terminal";
  }
  static getIcon() {
    return `data:image/png;base64,`;

  }
  isArrowKey(keyCode) {
    if (keyCode == this.JS_ARROW_UP || keyCode == this.JS_ARROW_DOWN || keyCode == this.JS_ARROW_LEFT || keyCode == this.JS_ARROW_RIGHT) {
      return true;
    }
    return false;
  }

  translateArrowKey(keyCode) {
    switch (keyCode) {
      case this.JS_ARROW_UP:
        return this.SSH_ARROW_UP;
      case this.JS_ARROW_DOWN:
        return this.SSH_ARROW_DOWN;
      case this.JS_ARROW_LEFT:
        return this.SSH_ARROW_LEFT;
      case this.JS_ARROW_RIGHT:
        return this.SSH_ARROW_RIGHT;
    }
  }

  closeWindow() {
    clearInterval(this.mUIThread);
    super.closeWindow();
  }

  finishResize(isFallbackEvent) { //Overloaded window-resize Event
    super.finishResize(isFallbackEvent);

    if (!this.mInitedTerminalView) {
      this.mTerminal.open($(this.mDiv).find('#terminal')[0]);
      //$($(this.mDiv).find('.terminal')[0]).css("padding-bottom", '0.5em');

      // Make the terminal's size and geometry fit the size of #terminal-container
      if (!this.mThreadActive) {
        this.mTerminal.write('Initializing Thread ['+this.mTools.arrayBufferToString(this.getThreadID) + '] and the Decentralized Terminal Interface (DTI).. \n\r');
        CVMContext.getInstance().initDTI(this.getProcessID, this.getThreadID); //instantiates a Terminal-instance specific DTi on remote full-node
        //app-id ==0 equals to a nUI-Global specific VM
      } else
        this.mTerminal.write('Attached to an already existing Thread. \n\r');

      this.mInitedTerminalView = true;
      this.mUIThread = setInterval(function() {
        this.refitTerminal();
      }.bind(this), 1000);
    }
    if (this.mInitedTerminalView) {
      setTimeout(this.refitTerminal.bind(this), 300);

    }
  }

  takeUserToHomeDir() {
    let context = CVMContext.getInstance();
    if (context.isLoggedIn) { //Teleport user to his home-directory - BEGIN
      //hide output
      let userID = context.getUserID;
      //  context.sendLine('cd ' + userID + "\r\n", this.getProcessID);

      let cmd = 'cd ' + userID;

      let metaGen = new CVMMetaGenerator();

      let reqID = metaGen.addRAWGridScriptCmd(cmd, eVMMetaCodeExecutionMode.GUITerminal, 0, 0, this.getProcessID);

      if (!CVMContext.getInstance().processVMMetaData(metaGen, this)) {
        this.mErrorMsg = "Unable to enter home-directory.";
        this.showMessageBox("Error", this.mErrorMsg, eNotificationType.error);

        return false;
      } else {
        this.addVMMetaRequestID(reqID); //success await result then
      }
      //show output
    } //Teleport user to his home-directory - END
  }
  VMStateChangedCallback(event) {
    //let the back-end know about the current Terminal's dimensions

    if (event.extended) { //we're now interested only in the new VM status signaling mechanics and signaling targeting this very UI application.
      //the full-node set the process ID once the DTI got initialized through CVMContext.initDTI()
      //no need for keeping track of requests' IDs etc. full node is now fully DTI/UI dApp process-aware.
      if (event.processID != this.getProcessID) {
        return; //not for this instance
      }
    } else {
      return;
    }

    switch (event.state) {

      case eVMState.limitReached:
        this.mTerminal.write('\n\r [Terminal]: Limit for DPTs reached. Unable to initialize. \n\r');
        break;
      case eVMState.initializing:
        CVMContext.getInstance().sendTerminalDimensions(this.mTerminal.rows, this.mTerminal.cols, this.getProcessID);
        this.mTerminal.write('\n\r [Terminal]: Initializing! \n\r');
        break;
      case eVMState.ready:
        this.mThreadActive = true;
        CVMContext.getInstance().sendTerminalDimensions(this.mTerminal.rows, this.mTerminal.cols, this.getProcessID);
        this.mTerminal.write('\x07');
        this.mTerminal.write('\n\r [Terminal]: Decentralized Thread ['+ this.mTools.arrayBufferToString(event.threadID)+ '] is now Ready! \n\r');

        if (event.vmFlags.getCmdExecutorAvailable) {
          //attempt to execute the instruction only after the Commands' Executor was reported to be available.
          //(a short moment BEFORE it's made available the VM/Thread itself
          //would become available, a seperate event is fired once the Executor is ready though)
          this.takeUserToHomeDir(); //ony once user is ready take him to his home directory
        }
        break;
      case eVMState.aboutToShutDown:
        this.mTerminal.write('\n\r [Terminal]: VM About to shut-down.. \n\r');
        break;
      case eVMState.disabled:
        this.mThreadActive = false;
        this.mTerminal.write('\n\r [Terminal]: VM Disabled.. \n\r');
        break;
      default:

    }
  }

  refitTerminal() {
    if (this.lastWidthRefitAt == this.getWidth &&
      this.lastHeightRefitAt == this.getHeight)
      return;

    let now = gTools.getTime();
    let instaceID = this.getProcessID;
    //  if ((now - this.mLastTimeConsoleResized) < 2000)
    //  return;

    this.mLastTimeConsoleResized = gTools.getTime();
    this.lastWidthRefitAt = this.getWidth;
    this.lastHeightRefitAt = this.getHeight;
    this.mFitAddon.fit();

    CVMContext.getInstance().sendTerminalDimensions(this.mTerminal.rows, this.mTerminal.cols, instaceID);

  }

  isSpecialKey(keyCode) {
    for (var i = 0; i < this.mSpecialKeys.length; i++) {
      if (this.mSpecialKeys[i] == keyCode)
        return true;
    }
    return false;
  }
  redraw() {
    if (this.mFitAddon != null)
      this.mFitAddon.fit();
  }

  stopResize(handle) {
    super.stopResize(handle);

    this.refitTerminal();
  }
  customKeyEventHandler(e) {
    if (e.key == "Control")
      return false;
    if (e.ctrlKey && (e.key == "v" || e.key == "c")) {
      if (e.key == "v") {
        this.pasteText();
      }

      return false;
    }
    return true;
  }

  pasteText() {
    if (this.mLastPastedTimestamp > 0 && ((gTools.getTime() - this.mLastPastedTimestamp) <= 1))
    {
      return;
    }
    this.mLastPastedTimestamp = gTools.getTime();
    navigator.clipboard.readText()
      .then(function(text) {
        for (var i = 0; i < text.length; i++) {

          text = new String(text);
          let charCode = text.charCodeAt(i);
          CVMContext.getInstance().sendKeyStroke(charCode, this.getProcessID);
        }

      }.bind(this))
      .catch(err => {});
  }


  onKeyHandler(KeyboardEvent) {
    let event = KeyboardEvent.domEvent;
    //console.log(event.keyCode);

    let instanceID = this.getProcessID;
    if (this.isSpecialKey(event.keyCode)) {
      if (!this.isArrowKey(event.keyCode)) {
        CVMContext.getInstance().sendKeyStroke(event.keyCode, this.getProcessID);
      } else {
        //for (var i = 0; i < KeyboardEvent.key.length; i++) {
        CVMContext.getInstance().sendKeyStroke(KeyboardEvent.key, this.getProcessID); //no need to iterate these bytes can be send just fine at once. Under the hood converted to ArrayBuffer
        //}
        //  CVMContext.getInstance().sendKeyStroke(this.translateArrowKey(event.keyCode));
      }
    } else if (event.ctrlKey) {
      let charCode = event.key.charCodeAt(0);
      switch (charCode) {
        case 122: //in browser CTRl+Z is used to interrupt instead of CTRL+C (leave CTRL+C alone for copy-pastes)
          charCode = 3;
          break;

        case 113: //translate to a Wall-key (CTRL+Q)
          charCode = 17; //TRL+Q
          break;
        case 115: //in Web-UI CTRL+S is used instead of CTRL+W to enter events view. CTRL+W is reserved in Chromium.
          charCode = 23; //translate to CTRL+W
          break;
        case 101:
          charCode = 5; //CTRL+E
          break;

        case 119: // on Chromium v4+ the CTRL+W key doesn't seem to be reserved (doesn't close the current Tab)when Browser's Windows is FULLSCREEN
          //in such a case the key-event MAY be handled in JS just fine
          charCode = 23 //CTRL+W
          break;
        default:

      }

      CVMContext.getInstance().sendKeyStroke(charCode, instanceID);
    } else
      CVMContext.getInstance().sendKeyStroke(event.key.charCodeAt(0), instanceID);


  }
  open() { //Overloaded Window-Opening Event

    let color = "#1b002f9C";
    this.mContentReady = false;

    super.open();
    //modify content here
    this.mTerminal = new Terminal({
      fontSize: 14,
      fontFamily: 'Consolas',
      cursorBlink: true,
      bellStyle: 'sound',
      bellSound: `data:audio/mpeg;base64,`,
      allowTransparency: true,
      theme: {
        background: '#00000000'
      }
    });
    this.mTerminal.attachCustomKeyEventHandler(this.customKeyEventHandler.bind(this));

    $(this.mDiv).find('#windowBody').css("background-color", color);
    this.mFitAddon = new FitAddon.FitAddon();
    this.mTerminal.loadAddon(this.mFitAddon);

    //
    this.mTerminal.onKey(this.onKeyHandler.bind(this));

  }



  loadLocalData() {
    return false;
    //  let addr = gLocalDataStore.loadValue('');
    //if (addr != null && gTools.isDomainIDValid(addr)) {
    //  this.getControl('').value = addr;
    //  this.mDomainID = addr;

  }

  newTerminalDataCallback(terminalData) {
    let uint8View = null; //new Uint8Array(terminalData.data.data1);

    if (terminalData.appID != this.getProcessID) {
      return;
    }

    switch (terminalData.dataType) {
      case eTerminalDataType.output:
        uint8View = new Uint8Array(terminalData.data.data1); //text within the first buffer
        this.mTerminal.write(uint8View);
        break;
      case eTerminalDataType.windowDimensions:
        //through the below, the full-node may actually control the Terminal window's dimensions
        if (terminalData.data2 === 'undefined')
          return;
        let width = arrayBufferToNumber(terminalData.data2);
        if (width <= 10)
          return;
        this.setWidth = width / 10; //under the assumption that each character is 10px wide
        break;
      default:
        break;
    }

  }

  newGridScriptResultCallback(result) {
    if (result == null)
      return;
    this.notifyResult(result);
    this.retrieveBalance();

  }

  notifyResult(result, immediateOne = false) {

  }
  newVMMetaDataCallback(metaData) {

    //  if (!this.hasNetworkRequestID(dfsMsg.getReqID))
    //  return;

  }
  newDFSMsgCallback(dfsMsg) {
    if (dfsMsg.getType == eDFSCmdType.error) {
      Swal.close();

    } else if (dfsMsg.getType == eDFSCmdType.commitSuccess) {
      Swal.close();

    }
  }
}

export default CTerminal;
